import React from 'react';

const UserInfo = ({ user }) => (
  <div className="user-info">
    <img src={user.profilePicture} alt="Profile" className="profile-picture" />
    <h2>{user.name}</h2>
    <p>{user.email}</p>
    <span className={`role ${user.role.toLowerCase()}`}>{user.role}</span>
  </div>
);

export default UserInfo;
